function Review({ props }) {
  return (
    <article className="book-review">
      <h2>{props.title}</h2>
      <h3>{props.author}</h3>
      <p>Image... {props.stars}</p>
      <h4>{props.review}</h4>
      <h5>{props.date}</h5>
    </article>
  );
}

export default Review;
